# Test dimmed plugin configuration (case-sensitive matching)
# One regex pattern per line

# File names in brackets (case-sensitive)
\[.*?\]

# Warning messages (case-sensitive - only exact "Warning:" matches)
Warning:.*

# Debug output (case-sensitive - only exact "Debug:" matches)
Debug:.*

# Error messages (case-sensitive - only exact "Error:" matches)
Error:.*

# Success messages (case-sensitive - only exact "Success:" matches)
Success:.*

# Info messages (case-sensitive - only exact "Info:" matches)
Info:.*